import React from "react";
import Modal from "react-modal";

const NoteModal = ({ isShowing, hide, todo }) =>
  isShowing ? (
    <Modal
      className="noteModal"
      isOpen={isShowing}
      onRequestClose={hide}
      contentLabel="Example Modal"
    >
      <button onClick={hide}>close</button>
      <input value={todo.title} />
    </Modal>
  ) : null;

export default NoteModal;
